    const dispatch=useDispatch();
    const [name, setName]=("")
    const handlerInputChagenge=(e)=>{
        e.preventDefault()
        setName(e.target.value)
        console.log(name)
    }
    return (
        <div>
            <input type="text" placeholder='Buscar' ></input>
            <button>Buscar</button>
